  //楼盘与地铁对应
  public function block_metro()
  {
    $this->load->model('community_model');
    $this->load->model('metro_model');

    $community = $this->community_model->getcommunity();
    $site = $this->metro_model->get_metro_site(array('b_map_x >' => 0, 'b_map_y >' => 0, 'is_show' => 1));

    $num = 0;
    if (is_full_array($site) && is_full_array($community)) {
      foreach ($site as $value) {
        foreach ($community as $com) {
          $p = $this->distanceBetween($value['b_map_y'], $value['b_map_x'], $com['b_map_y'], $com['b_map_x']);

          if ($p <= 1500) {
            $this->metro_model->set_block_metro(array('block_id' => $com['id'], 'metro_line_id' => $value['metro_id'], 'metro_site_id' => $value['id'], 'distance' => $p));

            $num++;
          }
        }
      }
    }

    echo $num;
  }


