  /**
   * 计算两个坐标之间的距离(米)
   * @param float $fP1Lat 起点(纬度)
   * @param float $fP1Lon 起点(经度)
   * @param float $fP2Lat 终点(纬度)
   * @param float $fP2Lon 终点(经度)
   * @return int
   */
  function distanceBetween($fP1Lat, $fP1Lon, $fP2Lat, $fP2Lon)
  {
    $fEARTH_RADIUS = 6378137;
    //角度换算成弧度
    $fRadLon1 = deg2rad($fP1Lon);
    $fRadLon2 = deg2rad($fP2Lon);
    $fRadLat1 = deg2rad($fP1Lat);
    $fRadLat2 = deg2rad($fP2Lat);
    //计算经纬度的差值
    $fD1 = abs($fRadLat1 - $fRadLat2);
    $fD2 = abs($fRadLon1 - $fRadLon2);
    //距离计算
    $fP = pow(sin($fD1 / 2), 2) +
      cos($fRadLat1) * cos($fRadLat2) * pow(sin($fD2 / 2), 2);
    return intval($fEARTH_RADIUS * 2 * asin(sqrt($fP)) + 0.5);
  }

  public function metro()
  {
    $city = $this->input->get('city', TRUE);

    $this->load->library('Curl');
    $ss = Curl::curl_get_contents("http://mtapi.house365.com/?method=newhouse.getHouseProfile&city=" . $city . "&client=tf&channl=app&v=6.0.5&api_key=iPhone");

    $arr = json_decode($ss, true);

    if (is_full_array($arr['data']['newhouse']['metro'])) {

      $tempa = 1;
      $this->load->model('task_model');
      foreach ($arr['data']['newhouse']['metro'] as $metro) {
        $line_name = $metro['name'];
        $station = $metro['station'];

        $metro_id = $this->task_model->add_data(array('line_name' => $line_name, 'order' => $tempa), 'db_city', 'metro_line');

        if (is_full_array($station)) {
          $tempb = 1;
          foreach ($station as $s) {
            if ($s['x'] > $s['y']) {
              $x = $s['x'];
              $y = $s['y'];
            } else {
              $x = $s['y'];
              $y = $s['x'];
            }
            $this->task_model->add_data(array('metro_id' => $metro_id, 'site_name' => $s['name'], 'b_map_x' => $x, 'b_map_y' => $y, 'order' => $tempb), 'db_city', 'metro_site');

            $tempb++;
          }
        }

        $tempa++;
      }
    }
  }

