  public function dealwh($p, $id, $brokerid, $total)
  {
    $this->load->model('stat_broker_data_model', 'bd');//房源查看模型类
    $this->bd->dbselect('db_city');

    $broker = explode("_", $brokerid);
    $sql = "update `mls_wuhan`.`sell_house` set broker_id = '" . $broker[0] . "', company_id = '" . $broker[1] . "', agency_id = '" . $broker[2] . "', broker_name = '' where id = '" . $id . "'";

    echo $sql;
    $this->bd->execute($sql);
    //sleep(1);
    $total++;
    echo "<script>window.location.href='/welcome/wh/" . $p . "/" . $total . "/?city=nj'</script>";
  }

  public function dealwh2()
  {
    $this->load->model('stat_broker_data_model', 'bd');//房源查看模型类
    $this->bd->dbselect('db_city');

    $sql = "select id, broker_id from `mls_wuhan`.`sell_house` where broker_id  > 0 and broker_name = '' order by id asc limit 0,1";
    $house = $this->bd->query($sql);

    if ($house[0]['id'] > 0) {
      $sql = "select truename from `mls_wuhan`.`broker_info` where broker_id = '" . $house[0]['broker_id'] . "'";
      $broker = $this->bd->query($sql);

      $sql = "update `mls_wuhan`.`sell_house` set broker_name = '" . $broker[0]['truename'] . "' where id = '" . $house[0]['id'] . "'";
      $this->bd->execute($sql);

      echo $house[0]['id'];
      echo "<script>window.location.href='/welcome/dealwh2/?city=nj'</script>";
    }
  }

