  //删除FTP图片
  public function delete_pic($url)
  {
    $pic = array();
    $pic[0] = $url;
    $pic[1] = str_replace('/thumb', '', $url);
    $pic[2] = str_replace('/thumb', '/initial', $url);

    $url = str_replace('mls/', 'mls_cutout/', $url);
    $pic[3] = $url;
    $pic[4] = str_replace('/thumb', '', $url);
    $pic[5] = str_replace('/thumb', '/initial', $url);

    $this->load->library('UploadFile', array('filename' => 'photo'), 'uf');

    foreach ($pic as $p) {
      $this->uf->remove($p);
    }
  }

  //删除采集图片
  public function delete_sell_collect_pic($id = 0)
  {
    $this->load->model('stat_broker_data_model', 'bd');//房源查看模型类
    $this->bd->dbselect('db');

    $id = intval($id);
    $time = 1465142400;
    $sql = "select id, picurl from `mls`.sell_house_collect where id > '" . $id . "' and picurl != '暂无资料' and updatetime < '" . $time . "' order by id asc limit 0,1";
    $data = $this->bd->query($sql);

    $id = intval($data[0]['id']);
    if ($id > 0) {
      $sql = "update `mls`.sell_house_collect set picurl = '暂无资料' where id = '" . $id . "'";
      $this->bd->execute($sql);

      $pic_str = $data[0]['picurl'];
      $pic_arr = explode('*', $pic_str);
      if (is_full_array($pic_arr)) {
        foreach ($pic_arr as $pic) {
          $this->delete_pic($pic);
          echo $pic . '<br />';
        }
      }

      echo "<script>window.location.href='" . MLS_JOB_URL . "/welcome/delete_sell_collect_pic/" . $id . "'</script>";
    } else {
      echo "over";
    }
  }

